import ReactDOM from 'react-dom';
import './index.css';
import React, { Component } from 'react';
import Item from './Item';

class ItemParent extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = {
      numTries: 0,
      sucTries: 0,
      overlapsBin: false,
    };
  }
  render() {
    return (
      <div>
        <Item bin={this.props.bin} />
      </div>
    );
  }

}
